import { Component } from '@angular/core';
import { GetRolModel } from 'src/app/Models/Rol/RolModel';
import { CreateUserModel } from 'src/app/Models/Users/CreateUserModel';
import { UserServiceService } from 'src/app/services/Users/user-service.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss']
})
export class RegisterComponent {
  user: CreateUserModel = {
    name: '',
    image: "", // Asigna la imagen base64 obtenida a la propiedad "image"
    lastName: '',
    secondLastName: '',
    dateOfBirth: new Date(),
    numberPhone: '',
    document: '',
    email: '',
    password: '',
    documentTypeId: 0,
    addressId: 0,
    rolId: 0,
  }
  roles: GetRolModel[] =
    [
      {
        id: 1,
        name: 'SuperAdmin'
      },
      {
        id: 1,
        name: 'Usuario de la pagina'
      }
    ]
  constructor(
    private userService: UserServiceService
  ) { }

  OnCreateUser(){

  }
  createUser() {
    this.userService.create(this.user)
      .subscribe(reponse => {
        console.log(reponse)
      });
  }
}
<div class="container">
  <h2>Registro de Usuario</h2>

  <form (ngSubmit)="onSubmit()" #registerForm="ngForm" class="register-form">
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="name">Nombre</label>
        <input type="text" id="name" name="name" class="form-control" [(ngModel)]="user.name" required>
        <p class="error-message" *ngIf="registerForm.controls['name'].invalid && registerForm.controls['name'].touched">
          El nombre es requerido.
        </p>
      </div>
      <div class="form-group col-md-6">
        <label for="lastName">Apellido</label>
        <input type="text" id="lastName" name="lastName" class="form-control" [(ngModel)]="user.lastName" required>
        <p class="error-message" *ngIf="registerForm.controls['lastName'].invalid && registerForm.controls['lastName'].touched">
          El apellido es requerido.
        </p>
      </div>
    </div>

    <!-- Resto de los campos del formulario de registro -->

    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="image">Cargar Imagen</label>
        <input type="file" id="image" name="image" class="form-control" (change)="onImageChange($event)" required>
      </div>
      <div class="form-group col-md-6">
        <img *ngIf="user.image" [src]="user.image" alt="Imagen del usuario" class="uploaded-image">
      </div>
    </div>

    <div class="form-group">
      <div class="text-center">
        <button type="submit" class="btn btn-primary">Registrarse</button>
      </div>
    </div>
  </form>
</div>
